exports.command = function( msg, next )
{
    if(typeof(msg) != 'object'){
        this._log.call( this, 'custom', msg );
    }else{
        this._log.call( this, 'custom', '----object log----' );
        for(var key in msg){
            this._log.call( this, 'custom', key + ':' + msg[key] );
        }
        this._log.call( this, 'custom', '----object log----' );
    }
    next();
};

